import React, { useState } from 'react';
import './PlaneButton.css';

const PlaneButton = ({ onClick }) => {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
    onClick();
  };

  return (
    <button
      className={`plane-button ${isClicked ? 'clicked' : ''}`}
      onClick={handleClick}
    >
      <span className="plane-icon" role="img" aria-label="plane icon">
        ✈️
      </span>
    </button>
  );
};

export default PlaneButton;
